fun main(args: Array<String>) {
    val data = (1..3).map {readLine()}
    val a = data.first()?.toInt()
    val b = data.elementAt(1)?.toInt()
    val n = data.last()?.toInt()
    val m = if(b != null && n != null) b*n else 0
    val ansR = if(a != null && n != null) a*n + m/100 else 0
    val ansK = m.rem(100)
    print("$ansR $ansK")
}

